{
  "root": true,
  "ignorePatterns": ["**/*"],
  "plugins": ["perfectionist", "@nx"],
  "overrides": [
    {
      "files": ["*.ts", "*.tsx", "*.js", "*.jsx"],
      "rules": {
        "no-console": "warn",
        "@nx/enforce-module-boundaries": [
          "error",
          {
            "enforceBuildableLibDependency": true,
            "allow": ["@amplication/ui/design-system"], //exclude @amplication/ui/design-system because we use a mix of Static imports and lazy loading
            "depConstraints": [
              {
                "sourceTag": "*",
                "onlyDependOnLibsWithTags": ["*"]
              }
            ]
          }
        ]
      }
    },
    {
      "files": ["*.ts", "*.tsx"],
      "extends": ["plugin:@nx/typescript"],
      "rules": {
        "no-prototype-builtins": "off"
      }
    },
    {
      "files": ["*.js", "*.jsx"],
      "extends": ["plugin:@nx/javascript"],
      "rules": {}
    },
    {
      "files": ["*.spec.ts", "*.spec.tsx", "*.spec.js", "*.spec.jsx"],
      "env": {
        "jest": true
      },
      "rules": {}
    },
    {
      "files": ["*.json"],
      "parser": "jsonc-eslint-parser",
      "rules": {
        "@nx/dependency-checks": "error"
      }
    }
  ],
  "extends": ["plugin:storybook/recommended"]
}

{
  "$schema": "http://json.schemastore.org/prettierrc",
  "singleQuote": false
}

{
  "babelrcRoots": ["*"]
}

import { CodegenConfig } from "@graphql-codegen/cli";
import type { Types } from "@graphql-codegen/plugin-helpers";
import serverProject from "./packages/amplication-server/project.json";

const generates = serverProject.targets[
  "graphql:models:generate"
].outputs.reduce(
  (acc, curr) => {
    curr = curr.replace("{workspaceRoot}/", "");
    if (curr === "packages/amplication-client/src/models.ts") {
      acc[curr] = {
        documents: ["packages/amplication-client/src/**/*.query.ts"],
        plugins: [
          "typescript",
          "typescript-operations",
          "typescript-react-apollo",
        ],
        config: { withHooks: true },
      };
    } else acc[curr] = { plugins: ["typescript"] };
    return acc;
  },
  {} as {
    [outputPath: string]: Types.ConfiguredOutput | Types.ConfiguredPlugin[];
  }
);

const config: CodegenConfig = {
  overwrite: true,
  schema: "packages/amplication-server/src/schema.graphql",
  config: {
    skipTypename: true,
  },
  generates,
};

export default config;

import { getJestProjects } from "@nx/jest";

export default {
  projects: getJestProjects(),
};

{
  "tasksRunnerOptions": {
    "default": {
      "runner": "nx-cloud",
      "options": {
        "cacheableOperations": [
          "prebuild",
          "build",
          "postbuild",
          "prepare",
          "test",
          "db:init",
          "lint",
          "test:e2e",
          "e2e",
          "test:cov",
          "build-storybook"
        ],
        "accessToken": "ZjczM2RhYjEtYzdmOS00MDVhLThkYWEtMDU4MmJkMTQ1ZWZjfHJlYWQ="
      }
    }
  },
  "pluginsConfig": {
    "@nx/js": {
      "analyzeSourceFiles": true
    }
  },
  "extends": "nx/presets/npm.json",
  "affected": {
    "defaultBase": "master"
  },
  "targetDefaults": {
    "test": {
      "dependsOn": ["db:prisma:generate", "^db:prisma:generate", "^prebuild"],
      "inputs": [
        "default",
        "^default",
        "{workspaceRoot}/jest.preset.js",
        "{workspaceRoot}/jest.preset.js"
      ]
    },
    "prebuild": {
      "dependsOn": ["^prebuild"]
    },
    "build": {
      "dependsOn": [
        "prebuild",
        "^build",
        "db:prisma:generate",
        "^db:prisma:generate"
      ]
    },
    "postbuild": {
      "dependsOn": ["build", "^postbuild"]
    },
    "serve": {
      "dependsOn": ["db:prisma:generate", "^db:prisma:generate", "^prebuild"]
    },
    "lint": {
      "inputs": ["default", "{workspaceRoot}/.eslintrc.json"]
    },
    "package:container": {
      "dependsOn": ["prebuild", "build", "postbuild"]
    },
    "e2e": {
      "inputs": ["default", "^default", "{workspaceRoot}/jest.preset.js"],
      "dependsOn": ["build"]
    }
  },
  "generators": {
    "@nx/react": {
      "application": {
        "style": "scss",
        "linter": "eslint",
        "bundler": "webpack",
        "babel": true
      },
      "component": {
        "style": "scss"
      },
      "library": {
        "style": "scss",
        "linter": "eslint",
        "unitTestRunner": "none"
      }
    }
  },
  "workspaceLayout": {
    "appsDir": "packages",
    "libsDir": "libs"
  },
  "defaultProject": "amplication-client",
  "$schema": "./node_modules/nx/schemas/nx-schema.json"
}
